import { Link } from "react-router-dom";
import header_img from "../Images/zomato_head.webp";
import "../HeaderComponent/Header.css"

const Header = () => {
  return (
    // shorcut for creating const funct is sfc
    <header className="max-w-[1100px]"  class="">
      <nav >
             <ul className="flex gap-2 justify-center items-center">

                  <li>
                  <a class="nav-link" href="#">
                  <img src={header_img} alt=""  class="img_header"/>
                  </a>
                  </li>
                  <li>
                    <div>Location</div>
                  </li>
                  <li>
                  <input className="border-[10px]" type="search" id="searchInput" placeholder="Enter your search query" />
                
                  </li>
                  <li> Login</li>
                  <li>Sign Up</li>
             </ul>
      </nav>
    </header>
  );
};

export default Header;
